import React, {useState} from "react"

export const AddIcon = props => {
    const [isAdding, activateAdding] = useState(false)

    const handleAddActivating = e => {
        activateAdding(!isAdding)
        props.handleAddActivating(e)
    }

    return (
        <svg className = 'addIcon' id = 'addIcon' onClick = {e => handleAddActivating(e)} width="250px" height="250px" viewBox="0 0 250 250" version="1.1">
            <defs>
                <rect x="-1878" y="25" width="1935" height="931" id="rect-1"></rect>
            </defs>
            <g id="Logo" stroke="none" stroke-width="1" fill="none" fill-rule="evenodd">
                <rect id="Rectangle-2" className = {    isAdding && 'activeFill' || !isAdding && ' inactiveFill'}
                      transform="translate(125.000000, 125.000000) rotate(90.000000) translate(-125.000000, -125.000000) " x="110" y="85" width="30" height="80" rx="15"></rect>
                <rect id="Rectangle-1"
                      className = { isAdding && 'activeFill' || !isAdding && ' inactiveFill'}
                      x="110" y="85" width="30" height="80" rx="15"></rect>
                <circle id="Oval"
                        className = { isAdding && 'activeStroke' || !isAdding && ' inactiveStroke' }
                        stroke-width="50" cx="125" cy="125" r="100"></circle>
            </g>
        </svg>
    )
}

export default AddIcon
